import React from "react";

export default function Search_sec() {
  return (
    <>
      <form>
        <input type="text" placeholder="Search Coin" name="search" />
        <button type="submit">
          <img src="/img/search-normal.png" alt="" srcset="" />
        </button>
      </form>
    </>
  );
}
